Trader.Utils.Cookie = {

    /**
     * @param   {string} cookieName
     * @returns {string}
     */
    getCookie: function(cookieName) {
        var c_value = document.cookie,
	        c_start = c_value.indexOf(' ' + cookieName + '=');

        if (c_start == -1) {
            c_start = c_value.indexOf(cookieName + '=');
        }

        if (c_start == -1) {
            c_value = null;
        } else {
            c_start = c_value.indexOf('=', c_start) + 1;
            var c_end = c_value.indexOf(';', c_start);
            if(c_end == -1) {
                c_end = c_value.length;
            }
            c_value = Trader.Utils.String.unescape(c_value.substring(c_start, c_end));
        }

        return c_value;
    },

    /**
     * @param {string}        cookieName
     * @param {number|string} value
     * @param {number}        expirationDays
     */
    setCookie: function(cookieName, value, expirationDays) {
        var exdate = new Date();
        exdate.setDate(exdate.getDate() + expirationDays);
        var c_value = Trader.Utils.String.escape(value) + ((expirationDays == null)
                ? ''
                : '; expires=' + exdate.toUTCString());
        document.cookie = cookieName + '=' + c_value;
    }
};

Trader.Utils.String = {

    /**
     * Wrapper for deprecated window.unescape()
     *
     * @param   {string} str
     * @returns {string}
     */
    unescape: function(str) {
        if (window.decodeURI) {
            return window.decodeURI(str);
        }
        if (window.unescape) {
            return window.unescape(str);
        }
    },

    /**
     * Wrapper for deprecated window.escape()
     *
     * @param   {string} str
     * @returns {string}
     */
    escape: function(str) {
        if (window.encodeURI) {
            return window.encodeURI(str);
        }
        if (window.escape) {
            return window.escape(str);
        }
    }
};

Trader.DataTable = {

    init: function(areaIdentifier) {
        var $dataTableWrap = $('#dataTableWrap'),
            $siteHeader    = $('#siteHeaderContainer'),
            $footer        = $('footer'),
            pageHeight     = document.body.clientHeight,
            wrapHeight     = pageHeight - $siteHeader.height() - $footer.height() - 100;

        // Init data-table height/overflow
        $dataTableWrap.css({
            height   : wrapHeight + 'px',
            overflowY: 'scroll'
       });

        Trader.DataTable.initSortingColumn(areaIdentifier);

        Trader.DataTable.initColumnSortObserver(areaIdentifier);
    },

    /**
     * Init click-observer on table column: store preference which column to sort by
     *
     * @param {string} areaIdentifier
     */
    initColumnSortObserver: function(areaIdentifier) {
        $('#dataTable').find('th').click(function(e) {
            var $target        = $(e.target),
                columnName     = $target.html().split("<")[0],
                isDescending   = $target.hasClass('sorttable_sorted_reverse'),
                // value: column | amount of clicks to restore sorting
                preferenceValue = columnName + '|' + (isDescending ? 1 : 2);

            Trader.Preference.save('sorting-column', areaIdentifier, preferenceValue);
        });
    },

    /**
     * Restore previous (if any) sort-by column
     *
     * @param {string} areaIdentifier
     */
    initSortingColumn: function(areaIdentifier) {
        $.ajax({
                   type   : 'POST',
                   url    : 'ajax-preference-load.php',
                   data   : 'preference=sorting-column' +
                            '&area=' + areaIdentifier,

                   /**
                    * @param {object} results
                    */
                   success: function(results) {
                       if (results) {
                           results = results.split('|');
                           $("#dataTable th:contains('" + results[0] + "')").trigger('click');
                           if (results[1] === '2') {
                               $("#dataTable th:contains('" + results[0] + "')").trigger('click');
                           }
                       }
                   }
               });
    }
};

Trader.Symbol = {

    initQuoteRefreshShown: function(symbolIDs) {
        $('#quote_refresh_shown').click(function() {
            document.location.href='ajax-refresh-symbols.php?ids=' + symbolIDs;
            return false;
        });    
    },
    
    /**
     * Install key-up observer: find symbols by freetext search over symbol table
     */
    initFindSymbolObserver: function() {
        var $sword = $('#sword');
        $sword.bind('keyup', function() {
            Trader.Symbol.requestSymbolSearch();
        });
    },

    requestSymbolSearch: function() {
        var $sword = $('#sword'),
            value  = $sword.val();

        $.ajax({
           type   : 'POST',
           url    : 'ajax-symbol-search.php',
           data   : 'sword=' + value,

           /**
            * @param {object} results
            */
           success: function(results) {
               var amountOptions = results.split("\n").length,
                   size = amountOptions < 15 ? amountOptions : 15,
                   $searchResults = $('#searchResults');

               $searchResults.html(results).attr('size', size);
               $(document).on('change', $($searchResults.find('option')), function(){
                   $('#symbol').val($('#searchResults option')[document.getElementById('searchResults').selectedIndex].value);
                   Trader.Symbol.requestQuote();
               });

               var amountSymbols = (amountOptions - 1);
               $('#results-summary').html(amountSymbols + ' ' + (amountSymbols === 1 ? 'Symbol' : 'Symbols'));
           }
       });
    },

    /**
     * @param {string} [symbol]
     * @param {*}      [$insertPopupBefore]
     */
    requestQuote: function(symbol, $insertPopupBefore) {
        symbol             = typeof symbol === 'undefined' ? $('#symbol').val() : symbol;
        $insertPopupBefore = typeof $insertPopupBefore === 'undefined'
            ? $('#mainForm')
            : $insertPopupBefore;

        if (symbol.length > 2) {
            $.ajax({
               type   : 'POST',
               url    : 'ajax-symbol-quote.php',
               data   : 'symbol=' + symbol,

               /**
                * @param {object} result
                */
               success: function(result) {
                   $('#popup').remove();

                   $('<div id="popup">' + result + '</div>').insertBefore($insertPopupBefore);
               }
           });
        }
    },

    requestQuoteNextListed: function() {
        $('#searchResults option:selected').next().attr('selected', 'selected');
        $('#symbol').val($('#searchResults option:selected').val());
        Trader.Symbol.requestQuote();
    },

    requestQuotePreviousListed: function() {
        $('#searchResults option:selected').prev().attr('selected', 'selected');
        $('#symbol').val($('#searchResults option:selected').val());
        Trader.Symbol.requestQuote();
    },

    toggleSearchInPortfolio: function() {
        var value = $('#sword').val();

        value = value.indexOf('<portfolio>')
            ? value.replace('<portfolio>', '')
            : value + '<portfolio>';

        $('#sword').val(value);
    },

    toggleSearchInWatchlist: function() {
        
    }
};

